
public class MultiDimentinal {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int arrary[][] = { { 1, 3, 4 }, { 3, 5, 7 }, { 6, 7, 8 } };

		for (int i = 0; i < 3; i++) {

			for (int j = 0; j < 3; j++)
				System.out.print(arrary[i][j] + " ");

			System.out.println();
		}
	}

}
